sys_variable_value.value:
(function execute(inputs, outputs) {
var appName = inputs.string;

var sp = inputs.split;

var countParts = (appName.match(/:/g) || []).length;

var partsArray = appName.split(sp);

outputs.parts1 = partsArray[0];
outputs.parts2 = partsArray[1];
outputs.parts3 = partsArray[2];
outputs.parts4 = partsArray[3];
outputs.parts5 = partsArray[4];
outputs.parts6 = partsArray[5];
outputs.parts7 = partsArray[6];
outputs.parts8 = partsArray[7];  
outputs.parts9 = partsArray[8];
outputs.parts10 = partsArray[10];
outputs.count = countParts;
})(inputs, outputs);

